  width: 40vw;
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: rgb(0,0,0,0.75);
  border-radius: 20px;
  font-size: 14px;
`

const NumberText = styled.div`
  color: white;
  display: flex;
  align-items: center;
`

const Number = styled.div`
  background-color: white;
  width: 35px;
  height: 20px;
  border-radius: 20px;
  text-align: center;
`
